import React from 'react';
import '../../css/Home.css';

class Home extends React.Component {
    render() {
        return (
            <div className="home-container">
                <div className="jumbotron jumbotron-fluid home-background">
                    <div className="container">
                        <h1 className="display-4 font-color-jumbotron">Let's dive!</h1>
                        <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                    </div>
                    <div className="home-grid">
                        <div className="home-grid-item">
                        <h1 className="display-3 font-color-jumbotron">Built for divers</h1>
                        <p className="lead-8">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                        </div>
                        <div className="home-grid-item">
                        <h1 className="display-4 font-color-jumbotron">Let's dive!</h1>
                        <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                        </div>
                        <div className="home-grid-item">
                        <h1 className="display-4 font-color-jumbotron">Let's dive!</h1>
                        <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
